INF = 2 ** 64 - 1
MOD = 10 ** 9 + 7

class Solution:
    #MLE 911 / 1331 个通过测试用例
    def minimizeConcatenatedLength2(self, words: List[str]) -> int: 
        self.ans = INF
        n = len(words)
        @cache
        def dfs(index, s):
            if index == n:
                self.ans = min(self.ans, len(s))
                return
            if s[-1] != words[index][0]:
                dfs(index + 1, s + words[index])
            else:
                dfs(index + 1, s + words[index][1:])
            
            if s[0] != words[index][-1]:
                dfs(index + 1,words[index] + s)
            else:
                dfs(index + 1,words[index] + s[1:])

            return 
        dfs(1,words[0])    
        return self.ans
    
    #MLE 911 / 1331 个通过测试用例
    #MLE 1328 / 1331 个通过测试用例
    def minimizeConcatenatedLength3(self, words: List[str]) -> int: 
        self.ans = INF
        n = len(words)
        #(first, last, len)
        @cache
        def dfs(index, first, last, cnt):
            # print(index, first, last, cnt)
            if index == n:
                self.ans = min(self.ans, cnt)
                return
            if last != words[index][0]:
                dfs(index + 1, first, words[index][-1],  cnt + len(words[index]))
            else:
                dfs(index + 1, first, words[index][-1], cnt + len(words[index]) - 1)
            
            if first != words[index][-1]:
                dfs(index + 1,words[index][0], last, cnt + len(words[index]))
            else:
                dfs(index + 1,words[index][0], last, cnt + len(words[index]) - 1)

            return 
        dfs(1,words[0][0],words[0][-1], len(words[0]))    
        return self.ans
    
    #MLE 911 / 1331 个通过测试用例
    #MLE 1328 / 1331 个通过测试用例
    #TLE 1330 / 1331 个通过测试用例 
    def minimizeConcatenatedLength4(self, words: List[str]) -> int: 
        # INF = 10
        ans = INF
        n = len(words)
        curr = [[INF]*26 for _ in range(26)]
        #(first, last, len)
        for i,v in enumerate(words):
            next = [[INF]*26 for _ in range(26)]
            if i == 0:
                next[ord(words[i][0]) - 97][ord(words[i][-1]) - 97] = len(words[i])
            else:
                for j in range(26):
                    for k in range(26):
                        if ord(v[0]) - 97 == k:
                            next[j][ord(words[i][-1]) - 97] = min(next[j][ord(words[i][-1]) - 97], curr[j][k] + len(v) - 1)
                        else:
                            next[j][ord(words[i][-1]) - 97] = min(next[j][ord(words[i][-1]) - 97], curr[j][k] + len(v))
                        
                        if ord(v[-1]) - 97 == j:
                            next[ord(words[i][0]) - 97][k] = min(next[ord(words[i][0]) - 97][k],curr[j][k] + len(v) - 1)
                        else:
                            next[ord(words[i][0]) - 97][k] = min(next[ord(words[i][0]) - 97][k], curr[j][k] + len(v))
            curr = next
            # print(curr)
        
        for i in range(26):
            for j in range(26):
                ans = min(ans,curr[i][j])
        return ans

    #MLE 911 / 1331 个通过测试用例
    #MLE 1328 / 1331 个通过测试用例
    #TLE 1330 / 1331 个通过测试用例 时间卡的太死了
    def minimizeConcatenatedLength5(self, words: List[str]) -> int: 
        n = len(words)
        #(first, last, len)
        @lru_cache(None)
        def dfs(index, first, last, cnt):
            # print(index, first, last, cnt)
            if index == n:
                return cnt
            ans = INF
            if last != words[index][0]:
                ans = min(ans,dfs(index + 1, first, words[index][-1],  cnt + len(words[index])))
            else:
                ans = min(ans, dfs(index + 1, first, words[index][-1], cnt + len(words[index]) - 1))

            if first != words[index][-1]:
                ans = min(ans, dfs(index + 1,words[index][0], last, cnt + len(words[index])))
            else:
                ans = min(ans, dfs(index + 1,words[index][0], last, cnt + len(words[index]) - 1))
            return ans
        
        ans = dfs(1,words[0][0],words[0][-1], len(words[0]))    
        return ans
    
    #AC
    def minimizeConcatenatedLength(self, words: List[str]) -> int: 
        # INF = 10
        ans = INF
        curr = defaultdict()
        #(first, last, len)
        for i,v in enumerate(words):
            next = defaultdict(lambda:INF)
            if i == 0:
                next[(ord(words[i][0]) - 97,ord(words[i][-1]) - 97)] = len(words[i])
            else:
                for key in curr:
                    j,k = key
                    if ord(v[0]) - 97 == k:
                        next[(j,ord(words[i][-1]) - 97)] = min(next[(j,ord(words[i][-1]) - 97)], curr[(j,k)] + len(v) - 1)
                    else:
                        next[(j,ord(words[i][-1]) - 97)] = min(next[(j,ord(words[i][-1]) - 97)], curr[(j,k)] + len(v))
                    
                    if ord(v[-1]) - 97 == j:
                        next[(ord(words[i][0]) - 97,k)] = min(next[(ord(words[i][0]) - 97,k)],curr[(j,k)] + len(v) - 1)
                    else:
                        next[(ord(words[i][0]) - 97,k)] = min(next[(ord(words[i][0]) - 97,k)], curr[(j,k)] + len(v))
            curr = next
            # print(curr)
        for k in curr:
            ans = min(ans,curr[k])
        return ans
    
    
